import React from 'react'
import './App.css';
import {useState, useEffect} from "react";

import { getTest } from './functions/test';

function App() {
  const [data, setData] = useState('Lorem Ipsum');
  useEffect(() => {
    getTest()
      .then((res) => {
        setData(res.message);
      })
      .catch((e) => console.log(e));
  }, []);
  return (
    <div>
      <h1>{data}</h1>
    </div>
  )
}

export default App

